import { useState } from "react"
const Home = () =>{
    let name = "mario"
    const handleclick =() =>{
        name = "luigi"
    }
    return (
        <div className="home">
            <h2>homepage</h2>
            <p>{name}</p>
            <button onClick={handleclick}>click me!</button>
            
            </div>
    );
}
export default Home
